      "iconName": "ios-plane"
    }
  },
  {
    "id": 3,
    "title": "理财收入",
    "price": 200, 
    "data": "2019-09-10",
    "category": {
      "id": "2",
      "name": "理财",
      "type": "income",
      "iconName": "logo-yen"
    }
  }
]

function App() {
  return (
    <div className="App">
      <Home />
    </div>
  );
}

export default App;
